import React, {Component} from 'react';
import './SideBar.css'

export default class SideBar extends Component{
	render(){
		return(
			<div className="SideBar">
				<ul>
					<li>Projects</li>
					<li>About</li>
				</ul>
			</div>
		)
	}
}
